//Home.js
import React, { useState } from "react";
import { Link } from "react-router-dom";

function Home() {
  const [user, setUser] = useState("");
  const logoutUser = () => {
    fetch("https://b2ee-202-44-212-44.ngrok-free.app//logout"),
      {
        method: "POST",
      };
  };

  return (
    <div>
      <h1>Welcome to this React Application</h1>
      //will check if user is logged in or not
      {user != null ? (
        <div>
          <h2>Logged in</h2>
          <h3>ID: {user.id}</h3>
          <h3>Email: {user.email}</h3>

          <button onClick={logoutUser}>Logout</button>
        </div>
      ) : (
        <div>
          <p>You are not logged in</p>
          <div>
            <a href="/login">
              <button>Login</button>
            </a>
            <a href="/register">
              <button>Register</button>
            </a>
          </div>
          <Link to="/testConfirmed">
            <h1>Go to testing</h1>
          </Link>
        </div>
      )}
    </div>
  );
}

export default Home;
